-- create temporary tables to enable joining.

CREATE TEMP TABLE tract_table AS (
  SELECT

    -- use conditional logic to zero fill tract FIPS codes where leading 0 has been omitted

    CASE WHEN LENGTH(raw_id) = 10
      THEN CONCAT('0', raw_id)
    ELSE raw_id END AS raw_id
  FROM UNNEST(tracts) AS raw_id
);

CREATE TEMP TABLE segment_table AS (
  SELECT
    *
  FROM unnest(segments) AS osmid
);

CREATE TEMP TABLE trips AS (
  SELECT

-- find DISTINCT activity_ids because one osmid can include multiple stableEdgeIds. We want a trip count,
-- not a count of segments used

    DISTINCT activity_id,
    network.osmid,
    raw_id AS tract
  FROM replica-customer.southwest.southwest_2021_Q4_thursday_trip AS trip,
    UNNEST(network_link_ids) AS nli 
  JOIN replica-customer.southwest.southwest_2021_Q4_population AS pop
    ON pop.person_id = trip.person_id

-- join trip table to network table so that we can obtain osmid info; trip table only includes stableEdgeId
-- (AKA network_link_id)

  JOIN replica-customer.southwest.southwest_2021_Q4_network_segments AS network
    ON network.stableEdgeId = nli
  JOIN segment_table st
    ON st.osmid = network.osmid
  JOIN tract_table tt 
    ON tt.raw_id = TRACT

-- this should be superfluous, but want to only select permanent residents

  WHERE resident_type = 'core');

SELECT
  COUNT(activity_id) AS trips,
  osmid,
  tract
FROM trips
GROUP BY osmid, tract 
ORDER BY tract, trips DESC

